import React, { Component } from "react";
import { TextField } from "@material-ui/core";

export default class Lgon extends Component {
  TextFieldStyle = {};

  render() {
    return (
      <div>
        <h2>LOGIN</h2>
        <TextField
          style={{ width: 300 }}
          id="outlined-dense"
          label="Email"
          margin="dense"
          variant="outlined"
        />
      </div>
    );
  }
}
